import {Link} from 'react-router-dom'

const Mainheader=()=>{
    return (<div>
            <nav>
            <ul>    
            <li ><Link to="/wel">Welcome</Link></li>
            <li ><Link to="/prod">Products</Link></li>
            </ul>
            </nav>
            </div>);
}
export default Mainheader;
